def predict(triples: list[Triple]) -> str:
    """
    Generates a natural language sentence from a list of triples.
    """
    if not triples:
        return ""

    sentence = ""
    subject = triples[0].subject
    clauses = []

    for triple in triples:
        if triple.predicate == "city":
            clauses.append(f"{subject} is a city in {triple.object}")
        elif triple.predicate == "country":
            clauses.append(f"{subject} is located in {triple.object}")
        elif triple.predicate == "capital":
            clauses.append(f"The capital of {subject} is {triple.object}")
        elif triple.predicate == "established":
            clauses.append(f"{subject} was established in {triple.object}")
        elif triple.predicate == "location":
            clauses.append(f"{subject} is located in {triple.object}")
        elif triple.predicate == "numberOfStudents":
            clauses.append(f"{subject} has {triple.object} students")
        elif triple.predicate == "academicStaffSize":
            clauses.append(f"{subject} has an academic staff of {triple.object}")
        else:
            clauses.append(f"{subject} {triple.predicate} {triple.object}")

    sentence = " ".join(clauses) + "."

    return sentence.strip()

